import React, { Component } from 'react';

export default class Header extends Component {
    render() {
        if(this.props.data){
            var name = this.props.data.name;
            var networks= this.props.data.social.map(function(network){
                return <li key={network.name}><a href={network.url}><i className={network.className}></i></a></li>
            })
        }

        return (
            <React.Fragment>
                <header id="home">

                    <div className="sidebar sbar">
                        <img className="profile-pic" alt="Dhiraj Wani Profile Pic" src="images/profilepic.jpg"></img>

                        <a className="active" id="sidestyle" href="#home">Home</a>
                        <a id="sidestyle" href="#about">About</a>
                        <a id="sidestyle" href="#resume">Resume</a>
                    </div>



                    <div className="row banner">
                        <div className="banner-text">
                            <h1 className="responsive-headline">I am {name}.</h1>
                        </div>
                        <ul className="social">
                            {networks}
                        </ul>
                    </div>
                    <p className="scrolldown">
                        <a className="smoothscroll" href="#about"><i className="icon-down-circle"></i></a>
                    </p>
                </header>
            </React.Fragment>
        );
    }
}
